import {useState} from 'react';
import './App.css';
import React from 'react';

function App() {
  const [counter, setCounter] = useState(0)
  return (
    <div>
    <div>{counter}</div>
    <button onClick={() => setCounter(counter + 1)}>+</button>
    <button onClick={() => setCounter()}>+</button>
    </div>
  );
}

export default App;
